#将文字下载下来
def get_chinese():
    text=[]
    url = 'http://s3plus.meituan.net/v1/mss_0a06a471f9514fc79c981b5466f56b91/svgtextcss/02b09df698eeb3f2a695cdb6340f63e9.svg'
    html = requests.get(url).text
    soup = BeautifulSoup(html, 'lxml')
    soup = soup.find_all('textpath')
    for i in soup:
        text.append(i.text)
    return text
#把键值对替换为对应的字符
def change(dic,text):
    for key,value in dic.items():
        text=text.replace(key,value)
    return text
